description:
Casino mobster Benedict knows who stole his money and he wants it back. Danny and his crew of thieves have just two weeks to steal $190m, or their lives will be forfeit, but who is the mystery thief competing for the loot? This time Benedict's ex-girlfriend is on their side, even an integral part of the plan.
